import react from "react";
import { Card } from "antd";

function TestCard() {
  return (
    <div>
      <Card
        title={<b>"SSID"</b>}
        // extra={<a href="#">More</a>}
        style={{
          width: 300,
          margin: "20px",
          borderRadius: "20px",
          overflow: "hidden",
        }}
      >
        <p>Card content</p>
        <p>Card content</p>
        <p>Card content</p>
        <p>Card content</p>
      </Card>
    </div>
  );
}

export default TestCard;
